import React, { Component } from 'react';
import { connect } from "react-redux";
import { clearVids } from '../actions/actions';
import { bindActionCreators } from 'redux';

class SearchList extends Component {

    render() {
        return (
            <div>
                <i class="fa fa-sliders text-secondary font-weight-bolder" aria-hidden="true"></i><small className="text-secondary ml-2 font-weight-bolder">FILTER</small>
                <hr className="bg-secondary w-75 ml-0"/>
                <ul className="list-unstyled">
                    {this.props.search.map((elem, index) => {
                        return <li>
                            <div className="p-2 m-3">
                                <img width="150" height="100" src={elem.snippet.thumbnails.default.url} alt="" />
                                <span className="ml-2 thumbTitle font-weight-bold">{elem.snippet.title}</span>
                            </div>
                        </li>
                    }
                    )}
                </ul>
            </div>
        )
    }
    componentDidMount() {
        this.props.clearVids()
        console.log("load hone ke baad", this.props)
    }
}

const mapStateToProps = (state) => {
    console.log("searchpage state", state)
    return {
        search: state.video.search
    }
}

const mapDispatchToProps = (dispatch) => {
    return bindActionCreators({
        clearVids
    }, dispatch)
}

export default connect(mapStateToProps, mapDispatchToProps)(SearchList)
